import  actionTypes  from "./actionTypes";
export const setCurrentUser = (user) => ({
  type: actionTypes.SETCURRENTUSER,
  payload: user,
});

export const googleSignInStart=()=>({
  type:actionTypes.GOOGLESIGNINSTART
})
export const googleSignInSuccess=(user)=>({
  type:actionTypes.g
})
